import {GET_PATIENT_FETCH, FETCHING_PATIENT_DATA, ERROR_PATIENT_DATA} from '../actions/patientActions'

const initialState = {
    fetchingData: true,
    getPatientData: [],
    erroPatientData:''
}

const patientReducer = (state, action) => {
    switch(action.type){
        case FETCHING_PATIENT_DATA :
            return {
                ...state,
                fetchingData:true
            }
    }
}

export default patientReducer
